import React, {useState} from 'react';
import TopNav from '../components/Navbar/TopNav';
import pedro from "../images/1.jpg";
import ShowPlants1 from '../components/ShowPlants1';
import { useNavigate } from 'react-router-dom';




const Profile = () =>{
    const navigate = useNavigate();

    function profile() {
      navigate('/profile');
    }


    return(
        <div className='full_div'>
            <TopNav />
            <center>
            <div style={{paddingLeft:'100px',marginTop:'50px'}}></div>

                        <div style={{ border: '2px solid green',padding: '20px', borderRadius: '10px', boxSizing: 'border-box', width: '80%' }}>

                        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', width: '100%', margin: '0 auto' }}>

            <div><img src={pedro} alt="Maria Florista" style={{marginLeft:'10px', width: '40%', height: '60%', objectFit: 'cover' }} /></div>
            <div style={{ border: '2px solid green',padding: '20px', borderRadius: '10px', boxSizing: 'border-box', width: '60%' }}>   
                <div><h3>Name : Maria Florista</h3></div>
                <div><h3>Location : Aveiro, Portugal</h3></div>
                <div><h3>About : We sell the freshest plants at the freshest prices!</h3></div>
                <div>
                    <h3>Rating : </h3>
                    <input type="radio" id="star-5" name="rating" value="5"/>
                    <input type="radio" id="star-4" name="rating" value="4"/>
                    <input type="radio" id="star-3" name="rating" value="3" />
                    <input type="radio" id="star-2" name="rating" value="2"  />
                    <input type="radio" id="star-1" name="rating" value="1"  />
                </div>
            </div>
            </div>
            <div style={{ marginTop:'10px'}}><h2>Your last purchases:</h2>
                <ShowPlants1></ShowPlants1>

            </div>
            </div>
            </center>
            </div>

    );
}

export default Profile;
